import React, { useEffect, useRef, useState } from 'react';
import './index.css';


// The data to display
const data = [
  {id: 1, name: 'John', age: 28},
  {id: 2, name: 'Jane', age: 25},
  {id: 3, name: 'Doe', age: 32}
];

// The table component
const Table = () => {
  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Age</th>
        </tr>
      </thead>
      <tbody>
        {data.map(row => (
          <tr key={row.id}>
            <td>{row.id}</td>
            <td>{row.name}</td>
            <td>{row.age}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
